      let lines = outputText.split('\n')
      
      let className = 'class'
      if (this.config.session.doRemoveHeader === true) {
        let headerLine = lines.shift()
        className = headerLine.slice(headerLine.indexOf(this.config.session.columnSeparator) + 1)
      }
      
      // ---------------------------
      
      let bags = []
      let classList = []
      let words = {}
      
