        let bag = bags[rowIndex]
        
        let row = Array(headersLength).fill(0)
        Object.keys(bag).forEach(word => {
          let index = words[word]
          row[index] = bag[word]
        })
        
        row.push(classList[rowIndex])
        rawData.push(row)
        
        if (i % 10 === 5) {
          //console.log('getClassifyText', 'rawData', ((len - i) / len))
          await this.sleep(0)
        }
